import styled from 'styled-components'

export const Wrapper = styled.div`
  padding: 5rem 0;

  background: ${({ theme }) => theme.colors.primary};
`

export const Content = styled.div`
  margin: 0 auto;
  width: 90%;
  max-width: 1140px;

  display: flex;

  justify-content: space-between;
`

export const Ellipse = styled.svg`
  position: absolute;

  z-index: -1;
`
